    //飞出道具去击打
    GameCode.prototype.flayProp = function (propName, role, lens) {
        var _this = this;
        var w = 0;
        var h = 0;
        var scX = Laya.Browser.window.scX;
        switch (propName) {
            case 'redp':
                w = 67, h = 56;
                break;
            case 'greenp':
                w = 70, h = 54;
                break;
            case 'bluep':
                w = 65, h = 58;
                break;
            case 'gayp':
                w = 59, h = 56;
                break;
            case 'yellowp':
                w = 50, h = 54;
                break;
        }
        var position = this.getPos(role.index);
        //这个是出现位置
        var sp = this.getImage("zhuye/" + propName + ".png", w * scX, h * scX, this.roleBox.x + role.x, this.roleBox.y + role.y - role.height / 2 + h * scX / 2);
        sp.pivot(sp.width / 2, sp.height / 2);
        sp.alpha = 0;
        var timeJd = new Laya.TimeLine();
        timeJd.to(sp, {
            y: sp.y - 20,
            alpha: 1
        }, 500, Laya.Ease.linearInOut, 0);
        var xTime = 0;
        if (position.x < 4) {
            xTime = Math.abs(4 - position.x);
        }
        else if (position.x > 5) {
            xTime = position.x - 5;
        }
        //具体飞向的位置
        var goX = 0;
        var goY = 0;
        var mainBox = this.main.centerBox;
        var arrIndex = 0;
        var toX = 290 * scX;
        var toY = -200 * scX;
        if (lens < 4) {
            var roleBox = mainBox.getChildAt(0);
            toX = 290 * scX;
            toY = -200 * scX;
        }
        else if (lens >= 4 && lens < 6) {
            var roleBox = mainBox.getChildAt(1);
            arrIndex = 1;
            toX = 150 * scX;
            toY = -200 * scX;
        }
        else if (lens >= 6 && lens < 8) {
            var roleBox = mainBox.getChildAt(3);
            arrIndex = 3;
            toX = -150 * scX;
            toY = -200 * scX;
        }
        else if (lens >= 8 && lens < 10) {
            var roleBox = mainBox.getChildAt(4);
            arrIndex = 4;
            toX = -290 * scX;
            toY = -200 * scX;
        }
        else { //消除是个的时候
            var roleBox = mainBox.getChildAt(2);
            arrIndex = 2;
            toX = 10 * scX;
            toY = -190 * scX;
        }
        //获取其子元素
        var gone = roleBox.getChildByName('gone');
        var sh = gone.sh;
        var zdNum = gone.zdNum;
        goX = mainBox.x + 47.5 * scX + roleBox.x + (roleBox.width - w) / 2;
        goY = mainBox.y + roleBox.height / 3;
        var txt = roleBox.getChildByName('zdTxt'); //子弹数
        timeJd.to(sp, {
            x: goX,
            y: goY,
            rotation: 2000,
        }, 200 + position.y * 50 + xTime * 30, Laya.Ease.linearInOut, 0);
        var pLen = lens;
        timeJd.on(Laya.Event.COMPLETE, this, function (e) {
            //播放装载声音
            // new SoundManager('shengyin/zb.mp3', false, 1);
            txt.zidan += 1;
            txt.sjzd += 1;
            gone.scaleX = 1;
            gone.scaleY = 1;
            if (txt.zidan >= config_1.default.gone[arrIndex].zdNum)
                txt.zidan = config_1.default.gone[arrIndex].zdNum;
            txt.text = txt.zidan + "/" + config_1.default.gone[arrIndex].zdNum; //设置子弹数量
            setTimeout(function () {
                gone.scaleX = .8;
                gone.scaleY = .8;
            }, 100);
            //去击打
            setTimeout(function () {
                _this.goPlayRole(roleBox, toX, toY, arrIndex, pLen);
            }, 200);
            sp.removeSelf();
        });
        timeJd.play(0, false);
        Laya.stage.addChild(sp);
    };
    GameCode.prototype.goPlayRole = function (target, x, y, index, pLen) {
        var _this = this;
        this.main.bloodImg();
        var scX = Laya.Browser.window.scX;
        var zd = this.getImage("xinzhuye/zd.png", 0, 0, 0, 0);
        zd.width = zd.getBounds().width * scX;
        zd.height = zd.getBounds().height * scX;
        var gone = target.getChildByName('gone');
        var txt = target.getChildByName('zdTxt');
        if (index == 0 || index == 1) {
            zd.pos(gone.width - zd.width / 2, -zd.height / 2);
        }
        else if (index == 3 || index == 4) {
            zd.pos(-zd.width / 2, -zd.height / 2);
        }
        else {
            zd.pos((gone.width - zd.width) / 2, -zd.height / 2);
        }
        //动画，让其飞过去击打
        var timePlay = new Laya.TimeLine();
        timePlay.to(zd, {
            y: y,
            x: x
        }, 100, Laya.Ease.linearInOut, 0);
        var propLen = pLen;
        if (propLen < 4) {
            new SoundManager_1.default('shengyin/shouqiang.mp3', false, 1);
        }
        else if (propLen >= 4 && propLen < 6) {
            new SoundManager_1.default('shengyin/chongfengqiang.mp3', false, 1);
        }
        else if (propLen >= 6 && propLen < 8) {
            new SoundManager_1.default('shengyin/buqiang.mp3', false, 1);
        }
        else if (propLen >= 8 && propLen < 10) {
            new SoundManager_1.default('shengyin/jujiqiang.mp3', false, 1);
        }
        else { //消除是个的时候
            new SoundManager_1.default('shengyin/daboluo.mp3', false, 1);
        }
        timePlay.on(Laya.Event.COMPLETE, this, function (e) {
            //播放被击打动画
            new SoundManager_1.default('shengyin/aida.mp3', false, 1);
            txt.zidan -= 1;
            txt.sjzd -= 1;
            if (txt.sjzd <= txt.zidan)
                txt.zidan -= 1;
            if (txt.zidan < 0)
                txt.zidan = 0;
            if (txt.sjzd < 0)
                txt.sjzd = 0;
            txt.text = txt.zidan + "/" + config_1.default.gone[index].zdNum;
            zd.removeSelf();
            //播放血条抖动
            if (Laya.Browser.onMiniGame) {
                Laya.Browser.window.wx.vibrateShort({
                    success: function (res) {
                    }
                });
            }
            _this.main.prosBox.scaleX += 0.1;
            _this.main.prosBox.scaleY += 0.1;
            _this.main.role.scaleY = .7;
            setTimeout(function () {
                this.main.prosBox.scaleX -= 0.1;
                this.main.prosBox.scaleY -= 0.1;
                this.main.role.scaleY = 1;
            }, 100);
            // let timePlay: any = new Laya.TimeLine();
            // timePlay.to(this.main.prosBox, {
            // 	scaleX: 1.2,
            // 	scaleY: 1.2
            // }, 100, Laya.Ease.linearInOut, 0);
            // timePlay.to(this.main.prosBox, {
            // 	scaleX: 1,
            // 	scaleY: 1
            // }, 100, Laya.Ease.linearInOut, 0);
            // timePlay.play(0, false);
            //添加红色字体
            var txtTip = new Laya.Text();
            txtTip.text = "-" + new FormatNumber_1.default(gone.sh).formatPointNumber();
            txtTip.color = '#e81313';
            txtTip.fontSize = 80;
            txtTip.bolb = true;
            txtTip.pos((178 * scX - txtTip.width) / 2, (239 * scX - txtTip.height) / 2.5);
            Laya.Tween.to(txtTip, {
                y: txtTip.y - 50 * scX, alpha: .1, update: Laya.Handler.create(_this, function (e) {
                })
            }, 500, Laya.Ease.circInOut, Laya.Handler.create(_this, function (e) {
                txtTip.removeSelf();
            }), 200);
            txtTip.zOrder = 1;
            _this.main.role.addChild(txtTip);
            //播放被击打
            _this.playSp((178 * scX - 159 * scX) / 2 + 178 * scX / 2, (239 * scX - 159 * scX) / 2.3);
            //具体击打操作
            config_1.default.userNowHp -= gone.sh;
            if (config_1.default.nowLevel > config_1.default.passLevel && !config_1.default.passOk) {
                config_1.default.passOk = true;
                _this.conPass();
                config_1.default.passLevel++;
            }
            if (config_1.default.userNowHp <= 0) {
                config_1.default.userNowHp = 0; //请求接口进入下一关
                config_1.default.nowLevel++;
                _this.main.setRoleImg(config_1.default.nowLevel);
                _this.main.leftTopImg(parseInt(config_1.default.nowLevel) + 1);
                if (!config_1.default.passOk) {
                    _this.conPass();
                    config_1.default.passLevel++;
                }
                config_1.default.passOk = true;
                _this.main.setLevel(config_1.default.nowLevel);
                if (config_1.default.nowLevel > 4) {
                    config_1.default.userHp = config_1.default.bossHpArr[config_1.default.bossHpArr.length - 1] + 100 * (config_1.default.nowLevel - 1);
                    config_1.default.userNowHp = config_1.default.bossHpArr[config_1.default.bossHpArr.length - 1] + 100 * (config_1.default.nowLevel - 1);
                }
                else {
                    config_1.default.userHp = config_1.default.bossHpArr[config_1.default.nowLevel];
                    config_1.default.userNowHp = config_1.default.bossHpArr[config_1.default.nowLevel];
                }
            }
            _this.main.setProsPos();
        });
        timePlay.play(0, false);
        gone.addChild(zd);
    };
