    Mains.prototype.propUp = function (e) {
        var _this = this;
        new SoundManager_1.default('shengyin/btn.mp3', false, 1);
        if (this.gameCode.account != undefined && this.gameCode.account)
            return;
        var target = e.target;
        Laya.timer.clear(this, this.downLoop);
        if (this.longDown) {
            this.longDown = false;
            if (Laya.stage.getChildByName(target.name + "Tip") != null)
                Laya.stage.removeChild(Laya.stage.getChildByName(target.name + "Tip"));
            return;
        } //如果是长按，什么都不做
        if (this.gameCode.useCZ)
            if (!this.gameCode.useCZOk)
                return;
        if (this.gameCode.useCZ || this.gameCode.gameEnd || this.gameCode.useBS || this.gameCode.useStar)
            return;
        if (target.nums == 0) { //代表没有数量，购买道具
            if (config_1.default.zsNum < 100) {
                new AllTip_1.default('钻石不足');
                var getDayGift = new PopupManager_1.default();
                Laya.stage.addChild(getDayGift);
                getDayGift.noZs(500, function (data) {
                    config_1.default.zsNum += data;
                    _this.zsNum.text = "" + new FormatNumber_1.default(config_1.default.zsNum).formatPointNumber();
                });
            }
            else {
                new GetData_1.default("/EatChicken/user/shop.action?type=100", 'get', {}, config_1.default.cookie, function (data) {
                    config_1.default.zsNum -= 100;
                    _this.setZsNum(config_1.default.zsNum);
                    _this.usePropEx(target.name);
                });
            }
            return;
        }
        //有数量，走这里
        if (target.name != 'pen') {
            target.nums -= 1;
            config_1.default.prop[target.name] -= 1;
            if (target.nums <= 0) {
                target.nums = 0;
                config_1.default.prop[target.name] = 0;
                var txt = target.getChildByName('oText').getChildAt(1);
                if (txt != null)
                    txt.text = '拥有:0';
                var showPay = target.getChildByName('oHaveImg');
                target.getChildByName('oText').visible = false;
                if (showPay != null)
                    showPay.visible = true;
            }
            else {
                var txt = target.getChildByName('oText').getChildAt(1);
                if (txt != null) {
                    txt.text = '拥有:' + target.nums;
                }
                var showPay = target.getChildByName('oHaveImg');
                target.getChildByName('oText').visible = true;
                if (showPay != null)
                    showPay.visible = false;
            }
        }
        else {
            Laya.timer.loop(10, this, this.update, [target]);
        }
        this.usePropEx(target.name);
    };
