    //使用道具
    Mains.prototype.usePropEx = function (name) {
        if (name == 'pen') {
            if (this.gameCode.useCZ || this.gameCode.gameEnd || this.gameCode.useBS || this.gameCode.useStar)
                return;
            this.gameCode.useBS = true;
            //循环随机拿个值
            while (true) {
                var rnd = this.gameCode.randomNum(0, 99);
                var roles = this.gameCode.roleBox.getChildAt(rnd);
                if (roles != null && roles != undefined) {
                    this.gameCode.userHammer(roles.index);
                    break;
                }
            }
        }
        else if (name == 'resetImg') {
            if (this.gameCode.useBS || this.gameCode.useCZ || this.gameCode.gameEnd || this.gameCode.useStar)
                return;
            var czImg_1 = new Laya.Sprite();
            czImg_1.graphics.drawRect(0, 0, Laya.stage.width, Laya.stage.height, '#fff');
            czImg_1.on(Laya.Event.CLICK, this, function (e) {
                return;
            });
            this.gameCode.gameEnd = true;
            czImg_1.zOrder = 99;
            var czHide = new Laya.TimeLine();
            czHide.to(czImg_1, {
                alpha: 0
            }, 500, Laya.Ease.linearInOut, 500);
            czHide.play(0, false);
            czHide.on(Laya.Event.COMPLETE, this, function (e) {
                czImg_1.removeSelf();
            });
            Laya.stage.addChild(czImg_1);
            new SoundManager_1.default('shengyin/shanguangdan.mp3', false, 1);
            this.gameCode.refresh();
        }
        else if (name == 'cz') {
            if (this.gameCode.useBS || this.gameCode.gameEnd || this.gameCode.useCZ || this.gameCode.useStar)
                return;
            if (this.gameCode.useCZ) {
                if (!this.gameCode.useCZOk)
                    return;
            }
            this.gameCode.useCZ = true;
            var noRepeat = this.gameCode.noClear();
            this.gameCode.usePercussion(noRepeat[this.gameCode.randomNum(0, noRepeat.length - 1)]);
        }
        else {
            console.log('使用流星');
            if (this.gameCode.useBS || this.gameCode.gameEnd || this.gameCode.useCZ || this.gameCode.useStar)
                return;
            this.gameCode.useStar = true; //使用流星
            this.gameCode.clearAnimationAll(); //清除所有动画
            var clearArr = this.gameCode.delRandom(5);
            // for (let i: number = 0; i < clearArr.length; ++i) {
            //     setTimeout(() => {
            this.gameCode.clearStar(clearArr, clearArr[0], false, true);
            // }, i * 300);
            // }
        }
    };
